import React from 'react';
import styled from 'styled-components';

function ResumeDetailBody() {
	return (
		<ComponentWrapper>
			<div className="ResumeDetail_ResumeDetail__body__basic__title__StGBM">
				<div>
					<input
						className="ResumeInput_ResumeInput__spGWu resume-input title basic"
						type="text"
						maxLength="100"
						placeholder="이력서 제목(필수)"
						name="title"
						value="이해찬"
					/>
				</div>
			</div>
			<div>
				<input
					className="ResumeInput_ResumeInput__spGWu resume-input name"
					type="text"
					maxLength="100"
					placeholder="이름(필수)"
					name="name"
					value="이해찬"
				/>
			</div>
			<div>
				<input
					className="ResumeInput_ResumeInput__spGWu resume-input email"
					type="email"
					maxLength="120"
					placeholder="이메일(필수)"
					name="email"
					value="cksgodl1@naver.com"
				/>
			</div>
			<div>
				<input
					className="ResumeInput_ResumeInput__spGWu resume-input mobile"
					type="tel"
					maxLength="200"
					placeholder="연락처(필수) ex) 010-0000-0000"
					name="mobile"
					value="+821026972321"
				/>
			</div>
			<div className="resumeDetail-body-about">
				<div className="ResumeDetail_ResumeDetail__body__about__header__YwQml">
					간단 소개글
				</div>
				<p className="ResumeDetail_ResumeDetail__body_guide__L73GX">
					• 본인의 업무 경험을 기반으로 핵심역량과 업무 스킬을 간단히
					작성해주세요. <br />• 3~5줄로 요약하여 작성하는 것을
					추천합니다!
				</p>
				<div className="dynamic-textarea">
					<textarea className="resumeinput-textarea" />
					<textarea
						className="DynamicTextarea_Textarea__clone__Bn_Ef"
						readOnly
					/>
				</div>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin-bottom: 60px;

	.DynamicTextarea_Textarea__clone__Bn_Ef {
		top: 0px;
		left: 0px;
		width: 1043px;
		padding: 0px;
		font-size: 16px;
		font-weight: 400;
		position: absolute;
		visibility: hidden;
		z-index: -9999;
		height: 0px;
		background: transparent;
		white-space: pre-wrap;
		word-break: break-all;
		word-wrap: break-word;
		caret-color: #000;
		overflow: hidden;
		line-height: 22px;
		-webkit-box-shadow: none !important;
		box-shadow: none !important;
		-moz-appearance: none;
		-webkit-appearance: none;
		resize: none;
	}

	.resumeinput-textarea {
		white-space: pre-wrap;
		word-break: break-all;
		word-wrap: break-word;
		caret-color: #000;
		overflow: hidden;
		line-height: 22px;
		-webkit-box-shadow: none !important;
		box-shadow: none !important;
		-webkit-appearance: none;
		resize: none;
		height: 22px;
		color: rgb(59, 61, 64);
		margin: 30px 0px 3px;
		font-size: 16px;
		height: 22px;
		color: rgb(59, 61, 64);
		margin: 30px 0px 3px;
	}
	.dynamic-textarea {
		position: relative;
		overflow-x: hidden;
	}
	input,
	textarea {
		-moz-appearance: none;
		-webkit-appearance: none;
		resize: none;
		border: none;
		outline: none;
	}

	.ResumeInput_ResumeInput__spGWu.email,
	.ResumeInput_ResumeInput__spGWu.mobile,
	.ResumeInput_ResumeInput__spGWu.name {
		font-size: 16px;
		margin-top: 10px;
		margin-bottom: 0;
	}
	.ResumeDetail_ResumeDetail__body__basic__title__StGBM {
		padding-top: 130px;
	}

	.ResumeInput_ResumeInput__spGWu.title.basic {
		color: #3b3d40;
		font-size: 36px;
		line-height: 36px;
		font-weight: 500;
		font-family: inherit;
		margin: 0 0 50px;
		white-space: pre-wrap;
		word-wrap: break-word;
		border: none;
		-webkit-appearance: none;
		resize: none;
		outline: none;
	}
`;

export default ResumeDetailBody;
